import style from './navpage.module.css';
import { useState } from 'react';
let page = 1;
const NavPage = () => {
    const [count, setCount] = useState(1);
    page = count;
    return (
    <div className={style.containerP}>
        
        <button className={style.buttonP} onClick={() => setCount(count - 1)}>Prev</button>
        <p className={style.elementP}>Page: {page} </p>
        <button className={style.buttonP} onClick={() => setCount(count + 1)}>Next</button>
    </div>   
    )

}

export {NavPage, page};
